import React from 'react';
import classes from './Profile.module.css';
import PersonInfo from './components/Profile/PersonInfo/PersonInfo';
import MyPosts from './components/Profile/MyPosts/MyPosts';

const Profile = () => {
    return (
        <div className={classes.content}>
        <div>
          <img src='https://arabiatravelnews.com/wp-content/uploads/2021/12/japan-1200x729-1.jpg'></img>
        </div>
        <PersonInfo />
        <MyPosts />

      </div>
    );
}
export default Profile;
